// App.js
import React from "react";
import Home from "./pages/Home.jsx";
import MoneyBook from "./pages/MoneyBook.jsx";
import { BrowserRouter, Routes, Route } from "react-router-dom";
//import "./App.css"; // 引入样式文件（如果有）

//App.js 是作为根组件，其他组件通常会在其中被嵌套。
const App = () => {
  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
          {" "}
          {/* <h1>Welcome to My React App!</h1> */}
          {/* React的路由注册在App.js根组件 */}
          <Route path="/" element={<Home></Home>}></Route>
          <Route path="/moneybook" element={<MoneyBook></MoneyBook>}>
            <Route index element={<MoneyBookHome />} />{" "}
            {/* 默认渲染 /moneybook */}
            <Route path="details" element={<MoneyBookDetails />} />{" "}
            {/* /moneybook/details */}
            <Route path="/:name" element={<MoneyBookEdit />} />{" "}
            {/* /moneybook/edit/:id 动态加载 */}
          </Route>
        </Routes>
      </BrowserRouter>
    </div>
  );
};

export default App; // 导出 App 组件
